import React from 'react';
import { Text, View, StyleSheet, TextInput, SafeAreaView, ScrollView, TouchableOpacity } from 'react-native';
import ProductView from '../components/ProductView';


function ShopScreen({ navigation }) {


    return (

        <SafeAreaView style={styles.maincont} >

            <TextInput style={styles.search}
                placeholder='search' />


            <Text style={styles.text1} >Shop With D-Wallet</Text>
            <ScrollView style={styles.productcont}>


                <ProductView />
            </ScrollView>

        </SafeAreaView>






    );
}
const styles = StyleSheet.create({
    maincont: {
        flex: 1,
        backgroundColor: "#475FFF80",


    },

    search: {
        top: 30,
        height: 50,
        color: 'black',
        width: "100%",
        textAlign: 'center',
        fontSize: 20,
        backgroundColor: 'white',
        borderRadius: 20,




    },
    productcont: {
        top: 10,
        flex: 1,
        backgroundColor: 'white'
    },
    text1: {
        marginTop: 35,
        textAlign: 'center',
        fontSize: 20,
        fontWeight: 'bold'



    },
    tab1: {
        backgroundColor: "red",

    }

})



export default ShopScreen;
